import React, { useState, useEffect } from 'react';
import axios from 'axios'

function ItemDtlTest() {
  // 요청받은 정보를 담아줄 변수 선언
  const [ testStr, setTestStr ] = useState('');

  // 변수 초기화
  function callback(str) {
    setTestStr(str);
  }

  // 첫 번째 렌더링을 마친 후 실행
  useEffect(
      () => {
        axios({
            url: '/hello',
            method: 'GET'
        }).then((res) => {
            callback(res.data);
        })
      }, []
  );

  return (
      <>
      <h1> {testStr} </h1>
      </>
  );
}

export default ItemDtlTest;
